    def image_thread_start(self):
        self.status_label.setText("Loading Image")

        self.image_button_method()
        # self.thread = threading.Thread(target=self.image_button_method).start()


    def image_button_method(self):

        name = QFileDialog.getOpenFileName(filter="Image files (*.jpg *.gif *.png *.bmp *.jpeg) \n All files (*)")

        if name[0] == '':
            return

        self.status_label.setText("Processing Image")

        super().__init__(name[0])

        status = super().predictions()
        if status == 1:
            self.status_label.setText("Unsuccessful")
            self.info_label.setText("Image could not be segmented properly")

            return

        # super().Solve_Sudoku()
        # print("solved")
        # print(self.sudoku)
        self.solve_button.setEnabled(True)
        self.update_ui_cells()
        self.status_label.setText("Done! Check for Errors")
        self.info_label.setText("Check for any errors and correct them")


